import React from 'react';

import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';


function PokeDex() {
  return (
      <Grid container spacing={4}>
        <Grid item xs={12} >
            <h1>hello</h1>
        </Grid>
        <Grid item xs={12} >
            <h1>world</h1>
        </Grid>
      </Grid>
  );
}

export default PokeDex;
